import Login from './component/Login';


function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
          <Route path="/1" element={<Login1/>} />
          <Route path="/login" element={<Login2/>} />
          <Route path="/2" element={<Acc/>} />
        </Routes>
     </Router>





    </div>
  );
}

export default App;
